package org.jn.core.java.student.azhan.operators.ifelse;

public class Problem34 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int num = 10;
		if(num<0)
			System.out.println("-1");
		else if(num>0)
			System.out.println("1");
		else
			System.out.println("Zero");
	}

}
